import React , {useEffect, useState} from 'react'
import {Link} from 'react-router-dom'
import './SubCategory.css'

function SubCategory(props) {

    const [PlacesArray, setPlacesArray] = useState([])
    const [CategoryName, setCategoryName] = useState()

    useEffect(
        () => {
            // on component mount 
            if (props.location.myparams) {
                console.log(props.location.myparams.TravelData)
                console.log(props.match.params.category)
                setPlacesArray(props.location.myparams.TravelData.PlacesArray)
                setCategoryName(props.match.params.category)
            }

            console.log(PlacesArray)


            return () => {
                // component unmount 

            }
        },

        [])


    useEffect(
        () => {
            console.log("hello data received", PlacesArray)
        },

        [PlacesArray])

    return (
        <div className='subCategoryRoot'>
            <div className='subCategoryName'>
                { CategoryName ? <p> {CategoryName} </p> : <p> no data receieved from server </p>}
            </div>

             <div className='categoryItems'>

                    if(PlacesArray){PlacesArray.map(Place => (
                        <div className='categoryItem' 
                            key={Place.id}
                        >
                            <img src={Place.CoverImage} />
                            <Link className='categoryItemName' to= {Place.Link} >  
                                <p> {Place.PlaceName} </p>
                            </Link> 
                        </div>  
                    ))} 
            </div> 

        </div>
    )
}

export default SubCategory
